msg_rec_image = message.Received(message_dict_image_attach)
assert isinstance(msg_rec_image.attachments, list)
assert isinstance(msg_rec_image.attachments[0], message.Attachments)
assert msg_rec_image.attachments[0].type == message_dict_image_attach['message'
    ]['attachments'][0]['type']
assert msg_rec_image.attachments[1].type == message_dict_image_attach['message'
    ]['attachments'][1]['type']
assert msg_rec_image.attachments[0].url == message_dict_image_attach['message'
    ]['attachments'][0]['payload']['url']
assert msg_rec_image.attachments[1].url == message_dict_image_attach['message'
    ]['attachments'][1]['payload']['url']
assert bool(msg_rec_image)
assert not msg_rec_image.text
